import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'front';
}
<!-- Toolbar -->


	<nav class="flex items-center justify-between flex-wrap bg-granny-400 h-44 p-6 fixed w-full z-10 top-0">

    <div>
      <img src="./assets/logoVintage.png" class="w-20"alt="" srcset="">
    </div>

    <div>

    </div>

    <div>

    </div>

		<div class="block lg:hidden">
			<button id="nav-toggle" class="flex items-center px-3 py-2 border rounded text-gray-500 border-gray-600 hover:text-white hover:border-white">
				<svg class="fill-current h-3 w-3" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><title>Menu</title><path d="M0 3h20v2H0V3zm0 6h20v2H0V9zm0 6h20v2H0v-2z"/></svg>
			</button>
		</div>


	</nav>

	<!--Container-->
	<div class="container shadow-lg mx-auto bg-purple-400 mt-24 md:mt-18 h-52">

	</div>

	<script>
		//Javascript to toggle the menu
		document.getElementById('nav-toggle').onclick = function(){
			document.getElementById("nav-content").classList.toggle("hidden");
		}
	</script>

<router-outlet></router-outlet>
